import React, { Component } from 'react';

class Products extends Component {
  render() {
    var products = [
      {
        id : 1,
        name : 'IP7',
        price : 700
      },
      {
        id : 2,
        name : 'IP8',
        price : 900
      },
      {
        id : 3,
        name : 'IPX',
        price : 1100
      }
    ]

    return (
      <div className="container">
          Products
          <div class="row">
            <div class="col-xs-4 col-sm-4 col-md-4 col-lg-4">

            </div>
          </div>
      </div>
    );
  }
}

export default Products;
